import React from 'react';
import './App.css';

function iBox(props){
  return (
    <form>4yy
    <label for="box">{props.name}</label>
    <input type="text" id="box"> </input>
    </form>
  );
}

function App() {
  return (
    <div className="App">
    <h1>Hello</h1>
    <form>
      <label for="box">Enter Text Here</label>
      <input type="text" id="box"> </input>
    </form>
    </div>
  );
}

export default App;
